import "./contact.css";

const About = () => {
  return (
    <div>
      <div className="portfolio">Get in Touch</div>
      <div uk-grid className="uk-grid">

          <div id="contactText">
              elizaregas@gmail.com

        </div>
      </div>
    </div>
  );
};

export default About;
